import React, { Component } from "react";
import VideoImg from "../assets/Images/video-list-1.jpg";

export default class VideosList extends Component {
  render() {
    return (
      <section className="videos-list">
        <div className="videos-list-container">
          <span className="videos-list-container__header">NEXT VIDEO</span>
          <div className="videos-list-container__video-element">
            <img
              className="videos-list-container__video-element--img"
              src="{VideoImg}"
              alt=""
              srcset=""
            />
            <div className="videos-list-container__video-element--info">
                <span  className="videos-list-container__video-element--img"></span>
            </div>
          </div>
        </div>
      </section>
    );
  }
}
